-- am facut triggerul asta care completeaza valoare_Estimata si pret_chirie automat 
CREATE OR REPLACE TRIGGER tr_calculate_estimated_rent
BEFORE INSERT ON  oltp_CONTRACT
FOR EACH ROW
DECLARE
    l_months NUMBER(10);
    l_price NUMBER(10);
BEGIN
    SELECT pret_inchiriere INTO l_price FROM  oltp_APARTAMENT WHERE id_apartament = :NEW.id_apartament;
    
    l_months := MONTHS_BETWEEN(:NEW.data_final, :NEW.data_inceput);
    :NEW.valoare_estimata := l_months * l_price;
    :NEW.pret_inchiriere := l_price;
END;
/








